import React, { Component } from 'react'
import {InfoConsumer} from '../context';
import { render } from '@testing-library/react';

class Home extends Component {
    render(){
        return (
            <InfoConsumer>
                {
                    data => <h2>{data}</h2>
                } 
            </InfoConsumer>
        )
    }
}
export default Home;
